import React from "react";
import Navigation from "../components/Navigation";

const Contact = () => {
  return (
    <div className="contact">
        <Navigation />
      <div className="left-part">
        <h2>Contactez-nous</h2>
        <p></p>
        <p></p>
      </div>
       
    </div>
  );
};

export default Contact;
